class TELBOTInit{constructor(){console.log("[TELBOT] TELBOTInit Ready")}init(e){MM.getModules().enumerate((a=>{if("EXT-TelegramBot"!==a.name&&(a.name.startsWith("EXT-")||"MMM-GoogleAssistant"===a.name||"Gateway"===a.name)&&"function"==typeof a.EXT_TELBOTCommands){var t=a.EXT_TELBOTCommands(new TelegramBotCommandRegister(a,e.TELBOTRegister.registerCommand.bind(e)));Array.isArray(t)&&t.forEach((t=>{e.TELBOTCmds.registerCommand(a,t)}))}}))}}